  max-width: 1170px;
  height: 120vh;
  display: flex;
  flex-direction: space-around;
  align-items: center;
  margin: 0 auto;
`;

const HeaderLeft = styled.div`
  width: 33.333%;
  text-align: left;
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Logotype = styled.div`

`

const HeaderRight = styled.div`
  width: 33.333%;
  text-align: right;
  padding: 26px 20px;
  display: flex;
  flex-diraction: space-between;
  align-items: center;
  font-size: 16px;
  font-weight: 700;
`;

const Button = styled.button`
  background-color: #6400e4;
  border: none;
  color: #fff;
  padding: 6px 16px;
  font-weight: 700;
  font-size: 16px;
  width: 332px;
  height: 56px;
  border-radius: 50px;
`;

function LandingHeader() {
  return (

      <Header>
        <HeaderLeft>
        <Logotype>/PRO</Logotype>
        <Button>Upgrade Now</Button>
        <Link link="Codeacademy for Bussines"/>
        </HeaderLeft>


        <HeaderRight>

        </HeaderRight>

      </Header>

  );
}
export default LandingHeader;
